{
"connections":{
"disable_by":"",
"hide_by":"",
"refresh_from":"",
"value":"BUTTON_FILT"
},
"metaData":{
"colorFalse":{
"desc":"Button background color when the state is OFF",
"order":"06",
"type":"color"
},
"colorTrue":{
"desc":"Button background color when the state is ON",
"order":"07",
"type":"color"
},
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"refresh_from":{
"desc":"If set the state of the component is updated based on the value read from this datapoint. Otherwise the value from main datapoint is used.",
"optional":true,
"order":"02",
"prev":[
"BUTTON_R"
]
},
"value":{
"desc":"The main datapoint where boolean value is written.",
"order":"01",
"prev":[
"BUTTON"
],
"write":true
}
},
"desc":"The Button component changes the boolean value. Normally the ON state means TRUE value and OFF mean FALSE value. If needed the parameter <code>reverseMeaning</code> switches the written values.<br /> There are three different modes of operation: <br /><code>PushButton</code> when press or touched the ON state is written to the target <code>value</code> datapoint. When released the OFF state is written.<br /><code>ManualPulse</code> always write TRUE value after button is pressed, release is ignored.(Suitable for MP block control)<br /><code>ToggleButton</code> when button is pressed the value is toggled (ON -> OFF -> ON).",
"fontScale":{
"desc":"Use this parameter to scale font because the button is using HTML button component which is not binded with SVG. ",
"order":"03",
"type":"float"
},
"labelColorFalse":{
"desc":"Label (text) color when the state is OFF.",
"order":"08",
"type":"color"
},
"labelColorTrue":{
"desc":"Label (text) color when the state is ON",
"order":"09",
"type":"color"
},
"labelFalse":{
"desc":"Button label when the state is OFF",
"order":"04",
"prev":[
"text"
],
"type":"str"
},
"labelTrue":{
"desc":"Button label when the state is ON. If not defined the <code>labelFalse</code> is used.",
"order":"05",
"type":"str"
},
"reverseMeaning":{
"desc":"If True the meaning of the value is switched. So the ON state is False and OFF state is True.",
"order":"02",
"type":"bool"
},
"type":{
"desc":"Changes the type of the Button.<br /><code>PushButton</code> when press or touched the ON state is written to the target <code>value</code> datapoint. When released the OFF state is written.<br /><code>ManualPulse</code> writes TRUE value once after button is pressed, release is ignored.<br /><code>ManualPulseRpt</code> writes TRUE value periodically (20ms period) after button is pressed, release stops writing.(Suitable for MP block control)<br /><code>ToggleButton</code> when button is pressed the value is toggled (ON -> OFF -> ON).",
"order":"01",
"type":"enum",
"values":[
"PushButton",
"ManualPulse",
"ManualPulseRpt",
"ToggleButton"
]
},
"writePerm":{
"columns":{
"login":{
"type":"str"
}
},
"desc":"List of logins who are allowed to write to the data point. If not in list the Button will be disabled.",
"order":"10",
"type":"table"
}
},
"options":{
"colorFalse":"#FFFFFF",
"colorTrue":"#00C8B4",
"fontScale":1,
"labelColorFalse":"#000000",
"labelColorTrue":"#FFFFFF",
"labelFalse":"Filtration Mode",
"labelTrue":"",
"reverseMeaning":"False",
"type":"ManualPulse",
"writePerm":[]
}
}

{
"HTMLexport":{
"ExcludeDefaultLibraries":false,
"ExpertMode":false,
"Header":"RPi - Pool Automation",
"Libs":[],
"Target":"../hmi/index.html",
"Template":"",
"Title":"Pool Automation",
"Tooltips":true,
"ViewBox":true,
"checkedVersion":"9030"
},
"UserData":{},
"connections":[
{
"alias":"BUTTON_FILT",
"cstring":"pool_inksc_task.MP_BUTTON:BSTATE",
"type":"W"
},
{
"alias":"FILTRATION",
"cstring":"pool_inksc_task.NOT_PUMP:U",
"type":"R"
},
{
"alias":"FILTRATION_MODE",
"cstring":"pool_inksc_task.ISSW_FMODE:SW",
"type":"R"
},
{
"alias":"ISDAY",
"cstring":"pool_inksc_task.AND_DAYLIGHT:Y",
"type":"R"
},
{
"alias":"LIGHTS",
"cstring":"pool_inksc_task.NOT_LIGHTS:U",
"type":"R"
}
],
"metaData":{
"desc":"Global RexHMI configuration component. User can change project options, configure the HTML export and define list of connections between REX target and HMI.",
"header_mode":{
"desc":"Change the default size of the header (thin, packed). If packed click on the logo to show the header.",
"order":"06",
"type":"enum",
"values":[
"",
"thin",
"pack-top-left",
"pack-top-right",
"pack-bottom-left",
"pack-bottom-right"
]
},
"kiosk_mode":{
"desc":"If True the links from header (from logo and header) are removed and user can not change the refresh rate and target.",
"order":"07",
"type":"bool"
},
"log_level":{
"desc":"Set the global log level for whole RexHMI. The log messages are written both to the right upper corner menu and to the web browser console. Default level is INFO.",
"order":"03",
"type":"enum",
"values":[
"",
"TRACE",
"DEBUG",
"INFO",
"WARN",
"ERROR"
]
},
"refresh_rate":{
"desc":"Changes the default read refresh rate of the whole HMI. Default 500ms",
"max":"300000",
"min":"20",
"order":"02",
"type":"int"
},
"show_clock":{
"desc":"If True the clock are shown in the right upper corner of the template instead of blinking square. If the target is connected the clock are updated if connection get error o lost the time stops.",
"order":"04",
"type":"bool"
},
"target_url":{
"desc":"The URL of the target device. So far only the WebSocket protocol is supported. The URL must also contain the PORT, but the protocol can be omitted. Default is empty string which means ws://127.0.0.1:8008 <br /> Examples: 192.168.1.100:8008 or wss://192.168.1.100:8009 <br /> <i> Note: If the HMI is hosted on the internal web server this option is ignored and HMI connects to the hostname / IP you use in the webbrowser URL.</i>",
"order":"01",
"prev":[
"ws_ip"
],
"type":"str"
},
"use_client_time":{
"desc":"If True the <code>show_clock</code> display the time from client computer rather then target. This can be use when target device does not have NTP synchronization or RTC chip.",
"order":"05",
"type":"bool"
}
},
"options":{
"header_mode":"",
"kiosk_mode":"False",
"log_level":"",
"refresh_rate":"",
"show_clock":"False",
"target_url":"",
"use_client_time":"False"
}
}
